import Header from "./components/Header/Header";
import RecentlyPlayed from "./components/RecentlyPlayed/RecentlyPlayed";

function App() {
    return (

        <div>

            <LeftMenu/>


            <div className="ms_content_wrapper">

                <Header />


                <RecentlyPlayed />

            </div>

            <PlayPanel/>

        </div>
    );
}

export default App;
